import React from "react";
import "./output.css";
import Profile_Pic from "./profilepic";

function Test() {
  return (
    <React.Fragment>
      <div className="w-[26vw] h-[85.4vh] mx-[12vw] mt-[7vh] sticky bg-[#303131] border border-white rounded-3xl grid grid-rows-[11fr_2fr_3fr_2fr_4fr]">
        <div className="border-b border-white">
          <Profile_Pic />
        </div>
        <div className="border-b border-white"></div>
        <div className="border-b border-white"></div>
        <div className="border-b border-white"></div>
        <div></div>
      </div>
    </React.Fragment>
  );
}

export default Test;
